    false,nt"url": null,nt"notes": "This analysis of impairment is regarding
    the proposal to create private ownership of 12 federally-leased cabin sites in the
    South Fork of Rock Creek as per the Charles M. Russell Enhancement Act of 2000.
     The purpose of this analysis of impairment is to further elaborate upon the biological
    and ecological reasoning behind the Service's decision not to approve the permanent
    conveyance to private ownership of South Fork cabin sites.The Service also determined
    that permanent private conveyance of the 12 cabin sites in the South Fork of Rock
    Creek would create unacceptable inholdings that would impair the management of the
    Refuge.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
